import React from 'react';

const PortfolioImage = (props) => (
    <>
        <div class= {props.category + "item col-sm-6 col-md-4 col-lg-4 mb-10"}>
            <a href={props.link} class="item-wrap fancybox">

            <img class="img-fluid" src={props.image}/>
            <div class="work-info">
                <h3>{props.title}</h3>
                <span>{props.category}</span>
            </div>
            </a>
        </div>
    </>
    );

export default PortfolioImage;
